      <text id="143" justification="0" size="4" underlined="false">

        <text>The Tests4J_ThreadManager provides 
two java.util.concurrent.ExecutorServices
for the following runnables, 
each has it&apos;s own sequence diagram;

Tests4J_TrialsRunnable  (Trials.seq)
Tests4J_RemoteRunnable (Remote.seq)
&lt;br/&gt;

Tests4J_TrialDescriptions produced by
Tests4J_SetupRunnables.</text>
